const UserNumber = accounts.length;
const MaxStep = logs.length;


module.exports = function(callback){

    const simulation =  async() => {

        //const chainId = await web3.eth.getChainId();
        //console.log('chainId=' + chainId);
        
        let instance = await contract.deployed();
        //console.log(instance);
        //console.log(instance.address);
        
        let count_updatePosition = 0;
        let count_sendPosition = 0;
        let count_getPosition = 0;

        //利用者シミュレーション
        for (step=0;step<MaxStep;step++) {
            for (user=0;user<UserNumber;user++){
                if (logs[step][user]['communicated'] == 0) {
                    // 自分のスマートタグの位置情報を更新する 
                    await instance.updatePosition(user,logs[step][user]['x'],logs[step][user]['y'], {from : accounts[user]});
                } else if (logs[step][user]['communicated'] == 1) { 
                    // 他利用者と接触し、位置情報を送信する 
                    await instance.sendPosition(logs[step][user]['ContactUser'],logs[step][user]['x'],logs[step][user]['y'],{from: accounts[user]});
                    // そして、紛失している場合は、位置情報の取得を試みる
                } else if (logs[step][user]['communicated'] == 1 && logs[step][user]['lost'] == 1) {
                    await instance.getPosition(user,{from: accounts[user]});
                } 
            }
        }
        //トークン残高確認
        for (let i = 0;i < accounts.length;i++) {
            balance = await instance.balanceOf(accounts[i]);
            console.log('accounts' + '[' + i +']=' + balance);
        }

        //位置情報の取得
        //const position = await instance.getTagsById().call(1,{from: accounts[0]});
        //console.log(position.toString());
        
        callback();
    };
    simulation();    
}